import React from 'react';

const Testimonials = () => {
    return (
        <div className="container">
            <div className="testimonials__outerText">
                <h2 className="testimonials__title">testimonials</h2>
                <h3 className="testimonials__text">our client reviews</h3>
            </div>
            <div className="testimonials">
                <div className="testimonials__card">
                    <div className="testimonials__card__figure1">
                        <img src={""} alt="" className="testimonials__card__pfp"/>
                    </div>
                    <div className="testimonials__card__figure2">
                        <h3 className="testimonials__card__title"></h3>
                        <h4 className="testimonials__card__subtitle"></h4>
                        <p className="testimonials__card__review"></p>
                        <img src="" alt="" className="testimonials__card__rate"/>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Testimonials;
